import React from 'react'
import '../Source/Styles/Login.css'




export default function Login(props) {
	return (
		<div className={props.Active ? 'LoginContainerVisible' : 'LoginContainer'} >
			<input type="text" />
			<input type="password" />
			<button>Войти</button>
		</div>
	)
}
